import React from "react";
import "./logo.css";

const Logo = () => (
  <div className="container">
    <div className="row">
      <div className="col-l12">
        <img
          className="img-fluid"
          alt="Responsive image"
          id="logo"
          src="https://www.dominospizza.es/images/2x1_finizzima_cast_PC.jpg"
        />
      </div>
    </div>
  </div>
);

export default Logo;
